import React from 'react';

class Comentario extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      currentTab: 'todos',
    };
  }

  handleTabChange = (tab) => {
    this.setState({ currentTab: tab });
  };

  handleVerOpinioesClick = () => {
    alert('Por que você apertou o botão? Ele é FAKE, cara!!!');
  };

  render() {
    const { currentTab } = this.state;

    return (
      <div className="component">
        <div className="tabs">
          <button
            className={currentTab === 'todos' ? 'active' : ''}
            onClick={() => this.handleTabChange('todos')}
          >
            Todos
          </button>
          <button
            className={currentTab === 'positivas' ? 'active' : ''}
            onClick={() => this.handleTabChange('positivas')}
          >
            Positivas
          </button>
          <button
            className={currentTab === 'negativas' ? 'active' : ''}
            onClick={() => this.handleTabChange('negativas')}
          >
            Negativas
          </button>
        </div>

        <div className="comments">
          {/* Comentários */}
          {currentTab === 'todos' && (
            <>
              <div className="comment">
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
                <div className="text">Comentário 1</div>
                <div className="time">Postado há 2 horas</div>
              </div>
              <div className="comment">
                              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
                <div className="text">Comentário 2</div>
                <div className="time">Postado há 1 dia</div>
              </div>
              <div className="comment">
                              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
                <div className="text">Comentário 3</div>
                <div className="time">Postado há 1 semana</div>
              </div>
            </>
          )}

          {/* Aba Positivas */}
          {currentTab === 'positivas' && (
            <>
              <div className="comment">
                              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
                <div className="text">Comentário Positivo 1</div>
                <div className="time">Postado há 3 dias</div>
              </div>
              <div className="comment">
                              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
              <span className="material-symbols-outlined">star</span>
                <div className="text">Comentário Positivo 2</div>
                <div className="time">Postado há 1 semana</div>
              </div>
            </>
          )}

          {/* Aba Negativas */}
          {currentTab === 'negativas' && (
            <>
              <div className="comment">
              <span className="material-symbols-outlined">star</span>
                <div className="text">Comentário Negativo 1</div>
                <div className="time">Postado há 2 semanas</div>
              </div>
              <div className="comment">
                <span className="material-symbols-outlined">star</span>
                <span className="material-symbols-outlined">star</span>
                <div className="text">Comentário Negativo 2</div>
                <div className="time">Postado há 3 semanas</div>
              </div>
            </>
          )}
        </div>

        <button className="ver-opinioes" onClick={this.handleVerOpinioesClick}>
          Ver outras opiniões
        </button>
      </div>
    );
  }
}

export default Comentario;
